import React, { Fragment } from "react";
import styles from './Header.module.css';
import Select from "react-select/src/select";

const Header = () => {
  return (
    <Fragment>
      <header className={styles.header}>
        <h1>Scooter Mail Army</h1>
        <Select className={styles.select} theme={theme => ({
      ...theme,
      borderRadius: 0,
      colors: {
        ...theme.colors,
        primary25: 'hotpink',
        primary: 'black',
      },
    })}>
          <option value="0" className={styles.option}>Usuario 1</option>
          <option value="1" className={styles.option}>Usuario 2</option>
          <option value="2" className={styles.option}>Usuario 3</option>
          <option value="3" className={styles.option}>Usuario 4</option>
          <option value="4" className={styles.option}>Usuario 5</option>
          <option value="5" className={styles.option}>Usuario 6</option>
          <option value="6" className={styles.option}>Usuario 7</option>
          <option value="7" className={styles.option}>Usuario 8</option>
          <option value="8" className={styles.option}>Usuario 9</option>
          <option value="9" className={styles.option}>Usuario 10</option>
        </Select>
      </header>
    </Fragment>
  );
};

export default Header;
